from django.db import models
from django.contrib.auth.models import User
from django.db.models.signals import post_save
from django.contrib.auth.models import User

# Create your models here.

class UserProfile(models.Model):
    user = models.OneToOneField(User, on_delete=models.CASCADE,related_name="profile")
    name = models.CharField( max_length=254, blank=True, unique=False,  null=True, verbose_name=('Full Name'))
    is_driver = models.BooleanField(default=False)
    def __str__(self):
        return str(self.name)

class Country(models.Model):

    name = models.CharField(max_length=254, blank=True,
                            unique=False, default="Country Name")

    def __str__(self):
        return self.name

class Province(models.Model):
    name = models.CharField(max_length=254, blank=True,
                            unique=False, default="")
    country = models.ForeignKey(Country, null=True, blank=True,
                                default=1, on_delete=models.CASCADE, related_name="provinces")

    
    def __str__(self):
        return self.name

class Area(models.Model):
    name = models.CharField(max_length=254, blank=True,
                            unique=False, default="")
    country = models.ForeignKey(Country, null=True, blank=True,
                                default=1, on_delete=models.CASCADE, related_name="areas")
    province = models.ForeignKey(Province, null=True, blank=True,
                                default="", on_delete=models.CASCADE, related_name="areas")
    lat = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)
    lng = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)

    def __str__(self):
        return self.name


class Driver(models.Model):
    user = models.OneToOneField(User, on_delete=models.CASCADE,related_name="driver")
    area = models.ForeignKey(Area, null=True, blank=True,
                            default="", on_delete=models.CASCADE, related_name="driver")
    
    lat = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)
    lng = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)
    def __str__(self):
        return str(self.user)

class Shipment(models.Model):
    area = models.ForeignKey(Area, null=True, blank=True,
                            default="", on_delete=models.CASCADE, related_name="shipments")
    
    address =  models.TextField( blank=True,
                           unique=False, default="",null=True)
    lat = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)
    lng = models.CharField(max_length=254, blank=True,
                           unique=False, default="",null=True)
    
    driver = models.ForeignKey(Driver, on_delete=models.CASCADE,related_name="driver", blank=True,null=True,default=None)
    is_complete = models.BooleanField(default=False)


    def __str__(self):
        return str(self.area)


### Functions used in models 

# Auto create user profiles
def create_user_profile(sender, instance, created, **kwargs):
    if created:
        UserProfile.objects.create(user=instance)
post_save.connect(create_user_profile, sender=User)


