def refreshLocations(country_name="Kuwait"):
    Country.objects.all().delete()
    Province.objects.all().delete()
    Area.objects.all().delete()

    locations = getLocations(country_name)
    
    for location in locations:
        province_english = location[0]
        province_arabic = location[1]
        area_english = location[2]
        area_arabic = location[3]
        area_lat = location[4]
        area_lng = location[5]

        check_country = Country.objects.filter(name=country_name)
        if(check_country.exists()):
            country = check_country.first()
        else:
            country = Country(name=country_name)
            country.save()

        check_province = Province.objects.filter(country=country, name=province_english)
        if(check_province.exists()):
            province = check_province.first()
        else:
            province = Province(country=country,name=province_english)
            province.save()

        check_area = Area.objects.filter(country=country,name=area_english,province=province)
        if(check_area.exists()):
            area = check_area.first()
        else:
            area = Area(country=country, name=area_english, lat=area_lat,lng=area_lng, province=province)
            area.save()


